DROP TABLE IF EXISTS `located`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `located` (
  `City` varchar(35) DEFAULT NULL,
  `Province` varchar(35) DEFAULT NULL,
  `Country` varchar(4) DEFAULT NULL,
  `River` varchar(35) DEFAULT NULL,
  `Lake` varchar(35) DEFAULT NULL,
  `Sea` varchar(35) DEFAULT NULL,
  KEY `City` (`City`),
  KEY `Country` (`Country`),
  KEY `Province` (`Province`),
  KEY `River` (`River`),
  KEY `Lake` (`Lake`),
  KEY `Sea` (`Sea`),
  CONSTRAINT `located_ibfk_1` FOREIGN KEY (`City`) REFERENCES `city` (`Name`),
  CONSTRAINT `located_ibfk_2` FOREIGN KEY (`Country`) REFERENCES `country` (`Code`),
  CONSTRAINT `located_ibfk_3` FOREIGN KEY (`Province`) REFERENCES `province` (`Name`),
  CONSTRAINT `located_ibfk_4` FOREIGN KEY (`River`) REFERENCES `river` (`Name`),
  CONSTRAINT `located_ibfk_5` FOREIGN KEY (`Lake`) REFERENCES `lake` (`Name`),
  CONSTRAINT `located_ibfk_6` FOREIGN KEY (`Sea`) REFERENCES `sea` (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
