--
-- Table structure for table `river`
--

DROP TABLE IF EXISTS `river`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `river` (
  `Name` varchar(35) NOT NULL,
  `River` varchar(35) DEFAULT NULL,
  `Lake` varchar(35) DEFAULT NULL,
  `Sea` varchar(35) DEFAULT NULL,
  `Length` float DEFAULT NULL,
  `SourceLongitude` float DEFAULT NULL,
  `SourceLatitude` float DEFAULT NULL,
  `Mountains` varchar(35) DEFAULT NULL,
  `SourceAltitude` float DEFAULT NULL,
  `EstuaryLongitude` float DEFAULT NULL,
  `EstuaryLatitude` float DEFAULT NULL,
  PRIMARY KEY (`Name`),
  KEY `River` (`River`),
  KEY `Sea` (`Sea`),
  CONSTRAINT `river_ibfk_1` FOREIGN KEY (`River`) REFERENCES `river` (`Name`),
  CONSTRAINT `river_ibfk_2` FOREIGN KEY (`Sea`) REFERENCES `sea` (`Name`),
  CONSTRAINT `EstCoord` CHECK (((`EstuaryLongitude` >= -(180)) and (`EstuaryLongitude` <= 180) and (`EstuaryLatitude` >= -(90)) and (`EstuaryLatitude` <= 90))),
  CONSTRAINT `RiverLength` CHECK ((`Length` >= 0)),
  CONSTRAINT `SourceCoord` CHECK (((`SourceLongitude` >= -(180)) and (`SourceLongitude` <= 180) and (`SourceLatitude` >= -(90)) and (`SourceLatitude` <= 90)))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

